import classes from "./TopBanner.module.css";
import TypedReactHook from '../UI/TypedElement';
import OutlinedButtonEl from '../UI/OutlinedButton';
import ContainedButtonEl from '../UI/ContainedButton';
import robot from "../../assets/robot.png";

const TopBanner = () => {
  return (
<div className={classes.flex}>
  <div className={classes["banner-text"]}>
    <TypedReactHook />
    <p>FinTechPort targets high-level talent and teams seeking support for government affairs, business promotion, and innovation development in Mainland China.</p>
    <ContainedButtonEl>Contact Now</ContainedButtonEl>
    <OutlinedButtonEl>Learn More</OutlinedButtonEl>
  </div>
  {/* <img src={robot} alt="Robot" className={classes["banner-image"]}/> */}
</div>
  )
};

